import logo from './logo.svg';
import './App.css';
import './canvas';


const Header = () =>{
  return (
      <header>
          <div className='logo'>
              <img src="nabla.svg" alt="nabla"/>
          </div>
      </header>
  );
};

function App() {
  return (
    <div className="App">
      <Header />

    </div>
  );
}

export default App;
